import Input from "./Input";

const Login = () => {
  return (
    <section className=" bg-blue-950 w-screen h-screen flex justify-center items-center">
      <div className="w-2/5 h-3/5  bg-white rounded-xl shadow-2xl shadow-black flex flex-col items-center justify-center">
        <h1 className="text-6xl ">Login</h1>
        <form className="flex justify-center flex-col">
          <Input placeholder="E-mail" type="email" label="Email" id="Email" />
          <Input
            placeholder="Password"
            type="password"
            id="Password"
            label="Password"
          />
          <button className="bg-blue-950 text-white p-3 m-3 hover:bg-green-500 ">
            Continue
          </button>
        </form>
      </div>
    </section>
  );
};

export default Login;
